// CameraGuide.js
import React from 'react';

const CameraGuide = () => {
  return (
    <div className="camera-guide">
      <h3>Proper Camera Placement</h3>
      <p>Ensure your camera is placed at eye level and your face is clearly visible.</p>
      <img src="camera_placement_guide.png" alt="Camera Placement Guide" />
    </div>
  );
};

export default CameraGuide;
